import React, {
  Component
} from 'react';
import './TutorSchedule.css';
import 'bootstrap/dist/css/bootstrap.css';

export default class TutorSchedule extends Component {

  render() {
    return (
      <div>
      <table className="table table-striped table-borderless table-hover table-card">
        <thead>
          <tr className="header">
            <th>Week Day</th>
            <th>From Time</th>
            <th>To Time</th>
            <th>Service Type</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
        {this.props.tutorScheduleDetails.map((value,index) => {
          return (<tr key = {index}>
            <td>{value.weekDay}</td>
            <td>{value.fromTime}</td>
            <td>{value.toTime}</td>
            <td>{value.serviceType}</td>
            <td><button disabled = {value.registerFlag == 1 || value.registerFlag == 2} className="btn btn-info" onClick = {this.props.register(this.props.userId)}>Register</button>
            <button disabled = {value.registerFlag == 0 || value.registerFlag == 2} className="btn btn-info" onClick = {this.props.pay(this.props.userId)} id = "paybtn">Pay</button></td>
          </tr>
        )})}
        </tbody>
        </table>
      </div>
    );
  }

}
